import React from 'react'
import axios from "axios";

const axiosConfig = axios.create({
        baseURL :  process.env.REACT_APP_NUSER_BASE_URL
})

export const login_Api  = async(login_info)=>{
        try{
            console.log(login_info)
            return  await  axiosConfig.get("/",login_info);

        }catch(err){
            console.log(err)
        }
    }
